import "./style/style.css"

const Frame = (item) =>{
    const positionY = item.cords.y * 5;
    const positionX = item.cords.x * 5;
    if(item.reserved)
        return(<div className="itemStyle" style={{left: positionY + "%", top: positionX + "%",background: "silver"}}>{item.id}</div>)
    return(<div className="itemStyle" style={{left: positionY + "%", top: positionX + "%"}}>{item.id}</div>)
}

export default Frame
